import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

class Songs extends Component {
  render() {
    return (
      <div
        className="container"
        style={{ textAlign: "center", border: "4px solid lightgrey" }}
      >
        {this.props.songs.map(song => {
          return (
            <div
              key={song.url}
              style={{
                display: "inline-block",
                textAlign: "center",
                margin: "3%"
              }}
            >
              <form onSubmit={this.props.showinfo}>
                <input type="text" value={song.mbid} hidden />
              </form>
              <button>
                <img
                  src={song.image[2]["#text"]}
                  style={{ borderRadius: "24px" }}
                />
              </button>
              <p style={{ fontWeight: "bold" }}>{song.name}</p>
              <p>{song.artist.name}</p>
            </div>
          );
        })}
      </div>
    );
  }
}

export default Songs;
